import React, { useRef, useEffect } from 'react';
import * as THREE from 'three';
import styled from 'styled-components';
import { FontLoader } from 'three/examples/jsm/loaders/FontLoader.js';
import { TextGeometry } from 'three/examples/jsm/geometries/TextGeometry.js';
import { Container, Row, Col } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './Home.css'; // Ensure you have this CSS file for custom styles
import image1 from '../assets/img1.png';
import image2 from '../assets/img2.png';
import image3 from '../assets/img3.png';
import image4 from '../assets/img4.png';
import image5 from '../assets/img5.png';
import image6 from '../assets/img6.png';

// Styled component for the text effect
const StyledTextEffect = styled.div`
  .text-container {
    margin-top: 50px;
    text-align: center;
  }

  .line {
    position: relative;
    font-size: 4em;
    letter-spacing: 5px;
    text-transform: uppercase;
    color: transparent;
    font-weight: 700;
    background: linear-gradient(90deg, #ff0047, #2c34fa);
    -webkit-background-clip: text;
    background-clip: text;
    display: inline-block;
    text-shadow: 0 5px 10px rgba(0, 0, 0, 0.3);
    opacity: 0;
    transform: translateY(100%);
    animation: enter 1.2s ease forwards;
    animation-delay: calc(var(--index) * 0.1s);
  }

  @keyframes enter {
    0% {
      opacity: 0;
      transform: translateY(100%);
    }
    100% {
      opacity: 1;
      transform: translateY(0);
    }
  }
`;

const Home = () => {
    const mountRef = useRef(null);

    useEffect(() => {
        // Add any Three.js effect if needed here
    }, []);

    return (
        <div className="background">
            {/* Top text effect */}
            <StyledTextEffect>
                <div className="text-container">
                    <div className="line" style={{ '--index': 0 }}>Welcome</div>
                    <div className="line" style={{ '--index': 1 }}>To</div>
                    <div className="line" style={{ '--index': 2 }}>My Portfolio</div>
                </div>
            </StyledTextEffect>

            <div ref={mountRef} className="three-js-container" />

            {/* Overlayed Bootstrap Container for Images and Titles */}
            <div className="overlay-content">
                <Container>
                    <Row className="mt-5">
                        <Col md={4} className="text-center">
                            <Link to="/project1">
                                <img src={image1} alt="Project 1" className="img-fluid w-100" />
                                <h5>Project 1 Title</h5>
                            </Link>
                        </Col>
                        <Col md={4} className="text-center">
                            <Link to="/project2">
                                <img src={image2} alt="Project 2" className="img-fluid w-100" />
                                <h5>Project 2 Title</h5>
                            </Link>
                        </Col>
                        <Col md={4} className="text-center">
                            <Link to="/project3">
                                <img src={image3} alt="Project 3" className="img-fluid w-100" />
                                <h5>Project 3 Title</h5>
                            </Link>
                        </Col>
                    </Row>
                    <Row className="mt-4">
                        <Col md={4} className="text-center">
                            <Link to="/project4">
                                <img src={image4} alt="Project 4" className="img-fluid w-100" />
                                <h5>Project 4 Title</h5>
                            </Link>
                        </Col>
                        <Col md={4} className="text-center">
                            <Link to="/project5">
                                <img src={image5} alt="Project 5" className="img-fluid w-100" />
                                <h5>Project 5 Title</h5>
                            </Link>
                        </Col>
                        <Col md={4} className="text-center">
                            <Link to="/project6">
                                <img src={image6} alt="Project 6" className="img-fluid w-100" />
                                <h5>Project 6 Title</h5>
                            </Link>
                        </Col>
                    </Row>
                </Container>
            </div>
        </div>
    );
};

export default Home;
